import React from 'react'


const ClientRegistration = (props)=>{
return(
   <>
    <div>
        <input type="text" placeholder='Enter the client Id#' />
        <input type="text" placeholder='Enter the client Name' />
        <input type="number" placeholder='Enter the mobile No' max={11} />
        <button onClick={props.registration}></button>
    </div>
   </>
)
}

export default ClientRegistration;
